package br.com.crescer.holeinthewallapi.service.muro;

import br.com.crescer.holeinthewallapi.domain.muro.Muro;
import br.com.crescer.holeinthewallapi.domain.partida.Dificuldade;
import br.com.crescer.holeinthewallapi.domain.partida.Partida;
import br.com.crescer.holeinthewallapi.domain.usuario.Usuario;
import br.com.crescer.holeinthewallapi.dto.partida.PartidaContinuarDto;
import br.com.crescer.holeinthewallapi.service.partida.BuscarPartidaAtualService;
import br.com.crescer.holeinthewallapi.service.partida.SalvarPartidaQuandoErrouService;
import br.com.crescer.holeinthewallapi.service.partida.ValidarSubirNivelService;
import br.com.crescer.holeinthewallapi.service.partida.ValidarTempoRequisicaoService;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import org.mockito.Mockito;
import org.mockito.junit.jupiter.MockitoExtension;
import org.springframework.http.HttpEntity;
import org.springframework.http.HttpStatus;
import org.springframework.http.ResponseEntity;
import org.springframework.web.client.RestTemplate;

import java.io.IOException;
import java.net.URISyntaxException;
import java.time.LocalDateTime;
import java.util.HashMap;
import java.util.Map;

@ExtendWith(MockitoExtension.class)
class CompararFotosServiceTest {

    @InjectMocks
    private CompararFotosService compararFotosService;

    @Mock
    private ValidarSubirNivelService validarSubirNivelService;

    @Mock
    private RestTemplate restTemplate;

    @Mock
    private BuscarPartidaAtualService buscarPartidaAtualService;

    @Mock
    private ValidarTempoRequisicaoService validarTempoRequisicaoService;

    @Mock
    private SalvarPartidaQuandoErrouService salvarPartidaQuandoErrouService;

    private HttpEntity<Map<String, String>> request;

    private ResponseEntity<String> response;

    private Partida partida;

    @BeforeEach
    void setup() {
        Usuario usuarioAutenticado = new Usuario("Ana", "Ana", "ana@mail.com", "abc");
        usuarioAutenticado.setId(1L);
        LocalDateTime dataEHoraDeAgora = LocalDateTime.now();
        int pontos = 125;

        this.partida = new Partida(Dificuldade.FACIL, pontos, dataEHoraDeAgora, usuarioAutenticado, 1, Dificuldade.FACIL.getVidas(), new Muro("", "[[1]]"), dataEHoraDeAgora, "");
        this.request = new HttpEntity<>(new HashMap<>());
        this.response = new ResponseEntity("[1]", HttpStatus.OK);
    }

    @Test
    void compararFotoTempoInvalido() throws IOException, URISyntaxException {
        String telaBrancaBase64 = "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAOEAAADhCAMAAAAJbSJIAAAAA1BMVEX///+nxBvIAAAASElEQVR4nO3BgQAAAADDoPlTX+AIVQEAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAADwDcaiAAFXD1ujAAAAAElFTkSuQmCC";

        Mockito.when(buscarPartidaAtualService.buscar(Mockito.anyLong())).thenReturn(this.partida);
        Mockito.when(validarTempoRequisicaoService.validarTempoRequisicao(this.partida)).thenReturn(false);
        Mockito.when(salvarPartidaQuandoErrouService.salvarPartida(this.partida)).thenReturn(this.partida);
        compararFotosService.compararFotos(telaBrancaBase64, 1L);

        Mockito.verify(validarSubirNivelService, Mockito.never()).subirNivel(Mockito.any(), Mockito.anyLong());
    }

    @Test
    void compararFotoAcertouOuErrou() throws IOException, URISyntaxException {
        String pessoaAgachadaBase64 = "data:image/jpeg;base64,";

        Mockito.when(restTemplate.postForEntity(Mockito.anyString(), Mockito.any(), Mockito.eq(String.class))).thenReturn(this.response);
        Mockito.when(validarSubirNivelService.subirNivel(Mockito.any(), Mockito.anyLong())).thenReturn(new PartidaContinuarDto());
        Mockito.when(buscarPartidaAtualService.buscar(Mockito.anyLong())).thenReturn(this.partida);
        Mockito.when(validarTempoRequisicaoService.validarTempoRequisicao(this.partida)).thenReturn(true);
        compararFotosService.compararFotos(pessoaAgachadaBase64, 1L);

        Mockito.verify(salvarPartidaQuandoErrouService, Mockito.never()).salvarPartida(Mockito.any());
    }

}
